import React, { useState } from "react";

import artist from "../images/artist.png";

export default function Portfolio() {
  const [image, setImage] = useState("");

  switch (image) {
    case "material":
      {
        artist;
      }
      break;
  }
  return (
    <div className="portfolio">
      <div style={{ flexDirection: "column", flexGrow: 1, width: "33%" }}>
        <ul>
          <li>The Deed</li>
          <li>Anthromes</li>
          <li onClick={setImage("artist")}>Material</li>
          <li>Personal Portfolio</li>
          <li>Simma</li>
          <li>Financial Auralizer</li>
          <li>Just Intonation</li>
        </ul>
      </div>
      <div style={{ flexDirection: "column", flexGrow: 1, width: "33%" }}>
        <img src={artist} alt="" width="100%" />
      </div>
      <div style={{ flexDirection: "column", flexGrow: 1, width: "33%" }}>
        DESCRIPTION
      </div>
    </div>
  );
}
